import React, { useContext, useEffect } from 'react';
import './skills.scss';
import { dataEn, dataFr } from './skillsData.js';
import Loading from '../../components/loading/loading.js';
import Balise, { BaliseOn, BaliseOff } from '../../components/balise/balise.js';
import { MainContext } from '../../context/mainContext.js';


const Skills = () => {

		const { main, dispatch } = useContext(MainContext);

		useEffect(() =>{
				dispatch({type: 'skillsPage'})
		},[dispatch]);

		const circleTopContent = (
				<div className='circleTopContent'>
						<span className='frontEnd'>Front-End</span>
						<span className='html skills'>HTML5</span>
						<span className='css skills'>CSS3</span>
						<span className='js skills'>JavaScript</span>
						<span className='ts skills'>TypeScript</span>
						<span className='react skills'>React-Js</span>
						<span className='sass skills'>Sass</span>
						<span className='redux skills'>Redux/Context</span>
				</div>
		)

return (
		<div className='skillsMain'>
				<Loading title='Skills'/>
				<div className='leftSide'>
						<Balise/>
						<div className='leftBlock'>
								<BaliseOn content='h1'/>
								<h1>{!main.french ? dataEn.title : dataFr.title}</h1>	
								<BaliseOff content='h1'/>
						</div>
						<div className='leftBlock'>
								<BaliseOn content='p'/>
								<p>{!main.french ? dataEn.content : dataFr.content}</p>
								<BaliseOff content='p'/>
						</div>
				</div>
				<div className='rightSide'>
				<div className='skillsContainer'>
						<div className='circleTop'>{circleTopContent}</div>
						<div className='circleRight'></div>
						<div className='circleBottom'></div>
				</div>
				</div>
		</div>
)};

export default Skills;
